bool c_Level::m_PlaceWire(c_Point* t_src,c_Point* t_dst){
	bb_logger_Debug->p_Log(String(L"PLACEWIRE: Wiring ",18)+t_src->p_ToString()+String(L" to ",4)+t_dst->p_ToString());
	c_IntPointMap2* t_connections=(new c_IntPointMap2)->m_new();
	c_List27* t_wirePoints=(new c_List27)->m_new();
	t_connections->p_Add7(t_src,0);
	t_wirePoints->p_AddLast27(t_src);
	while(t_wirePoints->p_Count()>0){
		c_Point* t_wirePoint=t_wirePoints->p_RemoveFirst();
		for(int t_dir=0;t_dir<=3;t_dir=t_dir+1){
			c_Point* t_offset=c_Util::m_GetPointFromDir(t_dir);
			c_Point* t_wirePointCandidate=t_wirePoint->p_Add6(t_offset);
			if(t_wirePointCandidate->p_Equals7(t_dst) || !m_IsWallAdjacent8(t_wirePointCandidate->m_x,t_wirePointCandidate->m_y)){
				if(m_IsFloorAt(t_wirePointCandidate->m_x,t_wirePointCandidate->m_y) && !t_connections->p_Contains5(t_wirePointCandidate)){
					t_connections->p_Add7(t_wirePointCandidate,t_wirePoint);
					t_wirePoints->p_AddLast27(t_wirePointCandidate);
				}
			}
		}
	}
	c_Point* t_dstKey=t_dst;
	if(t_connections->p_Contains5(t_dstKey)){
		c_Point* t_dstValue=0;
		int t_dirToPrev=-1;
		do{
			int t_dirToNext=-1;
			t_dstValue=t_connections->p_Get4(t_dstKey);
			if(t_dstValue!=0){
				int t_xDiff=t_dstValue->m_x-t_dstKey->m_x;
				int t_yDiff=t_dstValue->m_y-t_dstKey->m_y;
				if(t_xDiff>0){
					if(t_yDiff>0){
						t_dirToNext=4;
					}else{
						if(t_yDiff<0){
							t_dirToNext=7;
						}
					}
				}else{
					if(t_xDiff<0){
						if(t_yDiff>0){
							t_dirToNext=5;
						}else{
							if(t_yDiff<0){
								t_dirToNext=6;
							}
						}
					}else{
						if(t_yDiff>0){
							t_dirToNext=1;
						}else{
							if(t_yDiff<0){
								t_dirToNext=3;
							}
						}
					}
				}
				if(t_yDiff==0){
					if(t_xDiff>0){
						t_dirToNext=0;
					}else{
						if(t_xDiff<0){
							t_dirToNext=2;
						}
					}
				}
			}
			if(!m_IsExitAt(t_dstKey->m_x,t_dstKey->m_y)){
				c_Tile* t_wire=m_PlaceTileRemovingExistingTiles2(t_dstKey->m_x,t_dstKey->m_y,20);
				if(t_dirToPrev!=-1){
					t_wire->p_AddWireConnection(t_dirToPrev);
				}
				if(t_dirToNext!=-1){
					t_wire->p_AddWireConnection(t_dirToNext);
				}
			}
			int t_160=t_dirToNext;
			if(t_160==3){
				t_dirToPrev=1;
			}else{
				if(t_160==1){
					t_dirToPrev=3;
				}else{
					if(t_160==2){
						t_dirToPrev=0;
					}else{
						if(t_160==0){
							t_dirToPrev=2;
						}else{
							if(t_160==6){
								t_dirToPrev=4;
							}else{
								if(t_160==7){
									t_dirToPrev=5;
								}else{
									if(t_160==5){
										t_dirToPrev=7;
									}else{
										if(t_160==4){
											t_dirToPrev=6;
										}else{
											t_dirToPrev=-1;
										}
									}
								}
							}
						}
					}
				}
			}
			t_dstKey=t_dstValue;
		}while(!(t_dstValue==0));
		return true;
	}
	bb_logger_Debug->p_Log(String(L"PLACEWIRE: Failed to find route to destination",46));
	return false;
}
